	private static ConnectionFactory connectionFactory = null;
	private static Connection connection = null;
	private Session session = null;
	
	public Session getSession() {

		try {
			System.out.println("url: "+url);
			connectionFactory = new ActiveMQConnectionFactory(url);
			connection = connectionFactory.createConnection();
			// System.out.println(connection.getClientID());
			connection.start();
			// JMS messages are sent and received using a Session. We will
			// create here a non-transactional session object. If you want
			// to use transactions you should set the first parameter to 'true'
			session = connection.createSession(false, Session.AUTO_ACKNOWLEDGE);
		} catch (JMSException je) {
			je.printStackTrace();
		}

		return session;

	}

	public void sendMerchantRegEmail(MsgDto messageJSON) throws JMSException {

		if (session == null) {
			session = getSession();
		}
		Destination destination = session.createQueue(merchantRegister);
		String serverResponse = new Gson().toJson(messageJSON);

		MessageProducer producer = session.createProducer(destination);
		TextMessage message = session.createTextMessage(serverResponse);
		producer.send(message);

		System.out.println("Sentage '" + message.getText() + "'");
	}

	public void sendDeviceRegEmail(MsgDto messageJSON) throws JMSException {

		if (session == null) {
			session = getSession();
		}
		Destination destination = session.createQueue(deviceRegister);
		String serverResponse = new Gson().toJson(messageJSON);

		MessageProducer producer = session.createProducer(destination);
		TextMessage message = session.createTextMessage(serverResponse);
		producer.send(message);
		System.out.println("Sentage '" + message.getText() + "'");
	}

	public void sendResetMerchantPasswordEmail(MsgDto messageJSON) throws JMSException,ConnectionException {

		if (session == null) {
			session = getSession();
		}
		Destination destination = session.createQueue(resetMerchantPassword);
		String serverResponse = new Gson().toJson(messageJSON);

		MessageProducer producer = session.createProducer(destination);
		TextMessage message = session.createTextMessage(serverResponse);
		producer.send(message);
		System.out.println("Sentage '" + message.getText() + "'");
	}

